import React, { Fragment } from "react";
import Header from "./Components/Layout/Header";
import Meals from "./Components/Meals/MealsSummary";
import AvailableMeals from './Components/Meals/AvailableMeals'
function App() {
  return (
    <Fragment>
      <Header/>
      <main>
        <Meals/>
        <AvailableMeals/>
      </main>
    </Fragment>
  );
}

export default App;
